import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ShoppingList from "./components/ShoppingList";
import Register from "./components/Register";
import Login from "./components/Login";
import Dashboard from "./components/Dashboard";
import JoinList from "./components/JoinList";
import Navbar from "./components/Navbar";
<Router>
  <Routes>
    <Route path="/login" element={<Login />} />
    <Route path="/register" element={<Register />} />
    <Route
      path="/dashboard"
      element={
        <ProtectedRoute>
          <Navbar />
          <Dashboard />
        </ProtectedRoute>
      }
    />
    <Route
      path="/join"
      element={
        <ProtectedRoute>
          <Navbar />
          <Join />
        </ProtectedRoute>
      }
    />
    <Route
      path="/list/:id"
      element={
        <ProtectedRoute>
          <Navbar />
          <div>List Page</div> {/* Заменить на компонент списка, если есть */}
        </ProtectedRoute>
      }
    />
  </Routes>
</Router>

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route
          path="/dashboard"
          element={
            <ProtectedRoute>
              <Navbar />
              <Dashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/join"
          element={
            <ProtectedRoute>
              <Navbar />
              <Join />
            </ProtectedRoute>
          }
        />
        <Route
          path="/list/:id"
          element={
            <ProtectedRoute>
              <Navbar />
              <div>List Page</div> {/* Заменить на компонент списка, если есть */}
            </ProtectedRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
